export default function MyProjects() {
  return (
    <>
      <section className="py-10 md:py-[60px] bg-black h-[1824px]">
        <div className="container">
            <h2 className="font-SoraRegular">My <span className="font-SoraExtraBold">Projects</span></h2>
            <div></div>
        </div>
      </section>
    </>
  );
}
